import React, { Component } from "react";
import styled from "styled-components";
import { Button } from "../index";

class Card extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  componentDidMount(){
    console.log(this.props.number);
    console.log(this.props.title);

  }

  render() {

    return (
      <>
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            flex: 1,
            width: "100%",
            height: "100%",
            maxWidth: "252px",
            maxHeight: "284px",
            padding: "32px",
            borderRadius: "10px",
            boxShadow: "5px 5px 15px rgba(0, 0, 0, 0.15)",
            justifyContent: "space-evenly",
            alignItems: "center",
            marginBottom : this.props.number == 1 ? "100px" : "0px"
          }}
        >
          <div style={{marginBottom : this.props.key == 1 ? "20vh" : "0px"}}>
            <img src={this.props.img} />
            <div style={{ margin: "5%", fontSize: "1.2em", fontWeight: "500" }}>
              {this.props.title}
            </div>
            <div style={{ textAlign: "center", margin: "5%", fontSize: "1em", }}>
              {this.props.message}
            </div>
            <Button primary={!(this.props.title.indexOf("Private") > -1)}>
              {this.props.action}
            </Button>
          </div>
        </div>
      </>
    );
  }
}

export default Card;
